import Typography from '@material-ui/core/Typography';
import 'firebase/firestore';
import Image from 'material-ui-image';

import Avatar from '@material-ui/core/Avatar';
import { FirebaseAppProvider, useFirestoreDocData, useFirestore } from 'reactfire';
// components
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';

interface Idata {
   name: string

}

function Aboutme() {
  const nameref = useFirestore()
  .collection('sample')
  .doc('p862dyB86qetBFd4dXij');
  const {status, data:Idata} = useFirestoreDocData(nameref);
  if (status === 'loading'){
    return <p>Wait</p>
  }
  return <p>The burrito is {data.name}!</p>;
}



export default Aboutme;
